import ItemCount from "./Components/ItemCount"
import ItemList from "./Components/ItemList";
import Productos from "./db.json"
import './App.css';

function App() {

  const ropa = Productos.Ropa

  return (
    <div>
      <Navbar />
      <div>
        <Routes>
          <Route path="/"
          element={<ItemList productos={ropa}/>
          }/>
          {/*<ItemListContainer/>
          <ItemCount/> */}
        </Routes>
      </div>
    </div>
  );
}

export default App;
